INSERT INTO `catalog_pages` VALUES (1,-1,'','Trax Shop',1,4,'1','1','catalogue','',9,'default_3x3','catalog_frontpage_headline2_en','','','','','Klik op de item voor meer informatie.','','','BUILDER_NORMAL'),(2,-1,'front_page','Voorpagina',1,1,'1','1','catalogue','',1,'frontpage','catalog_frontpage_headline2_nl','frontpage_teaser','frontpage_teaser','<i><b><font color=\"#0E668C\" size=\"16\">Wat kan ik vinden in de catalogus?</font></b></i><br><br>Krijg meer kleding met Pixel Club, adopteer een huisdier als huismaatje of decoreer je kamer op de manier zoals jij dat leuk vind! Je kunt alles wat je nodig hebt vinden in onze catalogus.<br><br><li>Word lid van <a href=\"event:catalog/open/habbo_club\">Pixel Club</a></li><li><a href=\"event:catalog/open/set_pixelnew\">Decoreer</a> jou kamer</li><li>Adopteer <a href=\"event:catalog/open/pet_horse\">een huisdier</a>, <a href=\"event:catalog/open/bots\">Robot</a> of <a href=\"event:catalog/open/monster_plants_info\">Monsterplants</a></li><li>Maak je eigen <a href=\"event:catalog/open/category_wired\">Wired</a> games </li><li>Koop en verkoop op onze <a href=\"event:catalog/open/marketplace\">Marktplaats</a></li><br><i><b><font color=\"#0E668C\" size=\"16\">Hoe kom ik aan Credits?</font></b></i><br><br>Credits zijn gratis in PixelTime, als ze op zijn ga je naar de credits-pagina op de website en klik je op \'\'vernieuw mijn saldo\'\'!<br><br><a href=\"event:habblet/open/credits\">Bezoek onze credit-pagina!</a>','','','','','NORMAL'),(3,-1,'rentables','Duckets huuritems',1,178,'1','0','catalogue','',2,'default_3x3','catalog_frontpage_headline2_en','','','','','Klik op de item voor meer informatie.','','','BUILDER_NORMAL'),(4,3,'','Auto',1,16,'1','1','catalogue','',8,'default_3x3','catalog_automobile_header1_en','catalog_automobile_teaser1_en','','Every Brick needs a car effect! Not only do they bring a bit of the outside inside, they also enhance the air quality! And what better gift for a friend than a beautiful traffic sign